DROP TABLE IF EXISTS `perfil`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `perfil` (
  `id_perfil` int NOT NULL AUTO_INCREMENT,
  `nombre` varchar(45) NOT NULL,
  `pin` varchar(45) NOT NULL,
  `f_inicio` date NOT NULL,
  `f_fin` date NOT NULL,
  `fk_perfil_cliente` int NOT NULL,
  `fk_perfil_cuenta` int NOT NULL,
  `f_ingreso` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `user_ingreso` int NOT NULL DEFAULT '2',
  `f_modif` datetime DEFAULT NULL,
  `user_modif` int DEFAULT NULL,
  PRIMARY KEY (`id_perfil`),
  KEY `fk_perfil_cliente` (`fk_perfil_cliente`),
  KEY `fk_perfil_cuenta` (`fk_perfil_cuenta`),
  CONSTRAINT `fk_perfil_cliente` FOREIGN KEY (`fk_perfil_cliente`) REFERENCES `cliente` (`id_cliente`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_perfil_cuenta` FOREIGN KEY (`fk_perfil_cuenta`) REFERENCES `cuenta` (`id_cuenta`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=512 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
